import onboarding from '../../../Assets/Tinker/tenant-onboarding.gif';

function TenantContent() {
    return (
        <div>
            <div className="feature">
                <img src={onboarding} className="gif"/>
                <div className="step">
                    <h3>01. Step-By-Step Onboarding</h3>
                    <p>
                    Similar to other skincare apps and services, the first step is taking a short onboarding quiz. After consulting a professional dermatologist, we landed on 10-12 questions that help us personalize the products we show to users.

</p>
                </div>

            </div>
        </div>

      )
}

export default TenantContent;
